import React, { useState } from "react";
const New = () => {
  const [dress, setDress] = useState({
    materials: "",
    color: "",
    size: "",
  });

  const materials = [
    {
      label: "Cotton",
      value: "cotton",
    },
    {
      label: "Leather",
      value: "leather",
    },
    {
      label: "Banana",
      value: "banana",
    },
    {
      label: "Pineapple",
      value: "pineapple",
    },
  ];
  const color = [
    {
      label: "Red",
      value: "red",
    },
    {
      label: "Blue",
      value: "blue",
    },
    {
      label: "Banana",
      value: "banana",
    },
    {
      label: "Pineapple",
      value: "pineapple",
    },
  ];
  const size = [
    {
      label: 22,
      value: 22,
    },
    {
      label: 33,
      value: 33,
    },
    {
      label: "Banana",
      value: "banana",
    },
    {
      label: "Pineapple",
      value: "pineapple",
    },
  ];

  return (
    <div>
      <select>
        {materials.map((option) => (
          <option
            value={option.value}
            onChange={(e) => setDress({ ...dress, materials: e.target.value })}
          >
            {option.label}
          </option>
        ))}
      </select>
      <select>
        {color.map((option) => (
          <option value={option.value}>{option.label}</option>
        ))}
      </select>
      <select>
        {size.map((option) => (
          <option value={option.value}>{option.label}</option>
        ))}
      </select>
    <h2>{dress.materials}</h2>
    </div>
  );
};
export default New;
